import React, { Component } from "react"

class Todo extends Component {


    render() {

        return (
            <li>
                <div className="view">
                    <input className="toggle" type='checkbox' checked={this.props.todo.isCompleted} />
                    <label>{this.props.todo.text}</label>
                    <button className="destroy"></button>

                </div>
            </li>
        )
    }
}

export default Todo;
